import React from "react";
import "../css/homepage.css";

const Homepage = () => {
  return (
    <div className="">
      <main id="main">
        <div class="row">
          <div class="col-3">
            <img src="https://www.google.com/search?q=image&rlz=1C1VDKB_enTH1008TH1008&sxsrf=ALiCzsbXCX5JC2d0VzApzMDt-UtbupjTZw:1657599837489&tbm=isch&source=iu&ictx=1&vet=1&fir=sp12V8x9gw6KuM%252C4O2GvGuD-Cf09M%252C_%253BDH7p1w2o_fIU8M%252CBa_eiczVaD9-zM%252C_%253Bn5hAWsQ-sgKo_M%252C-UStXW0dQEx4SM%252C_%253BzaeV_rMRcDKaeM%252CvEDihwTAVXMOdM%252C_%253BkwgHAQqTiLQXLM%252CR0KnAtfyBDsyiM%252C_%253B-VCM1w56w6u5VM%252CaVwfeogQqK1XmM%252C_%253B2DNOEjVi-CBaYM%252CAOz9-XMe1ixZJM%252C_%253B2nDXavJs9DoKTM%252CB51x0PBR9KNzvM%252C_%253BL2hxXuK7NBWJmM%252C0JWe7yDOKrVFAM%252C_%253B0vb1Fq79Feed-M%252CR0KnAtfyBDsyiM%252C_%253BMOAYgJU89sFKnM%252CygIoihldBPn-LM%252C_%253BRG39b_e3vWHy1M%252CS5HJ2IRoCTMOEM%252C_&usg=AI4_-kR8bTpn6qvVaZz0qsQ8TXMILav6mA&sa=X&ved=2ahUKEwjM5fjLwPL4AhUaxDgGHVHVBjcQ9QF6BAgEEAE&biw=1536&bih=746&dpr=1.25#imgrc=sp12V8x9gw6KuM" class="img-fluid" alt="" />
          </div>
          <div class="col-3">
            <img src="images/logo--white.png" class="img-fluid " alt="" />
          </div>
          <div class="col-lg-3">aaaaaaaa</div>
          <div class="col-3">aaaaaaaa</div>
        </div>
      </main>
    </div>
  );
};

export default Homepage;
